import React from 'react';
import { Carousel } from 'react-bootstrap';
import image1 from './Images/image1.jpg';
import image2 from './Images/image2.jpg';
import image3 from './Images/image3.jpg';
import image4 from './Images/image4.jpg';
import './LocalDetails.css';
import DatePicker from "react-datepicker";
import "react-datepicker/src/stylesheets/datepicker.scss";
import 'bootstrap/dist/css/bootstrap.min.css';

class LocalDetails extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            arrivalDate: null,
            departureDate: null
        };
    }

    render() {
        const images = [image1, image2, image3, image4];

        return (
            
            <div className="container bg-light ">
                <div className="row">
                  <div className="col-9">
                      <h1>Title</h1>
                  </div >
                    <div className="col-3">
                        <p>blassa dyal 7lima</p>
                    </div>
                </div>
                <div className="row">
                    <div className="col-6">
                        <img className="m-1 img-fluid" src={images[0]}/>
                    </div>
                    <div className="col-6">
                        <div className="row">
                            <div className="col-6">
                            <img className="m-1 img-fluid" src={images[0]}/>
                            </div>
                            <div className="col-6">
                            <img className="m-1 img-fluid" src={images[1]}/>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-6">
                            <img className="m-1 img-fluid" src={images[2]}/>
                            </div>
                            <div className="col-6">
                            <img className="m-1 img-fluid" src={images[3]}/>
                            </div>
                        </div>
                    </div>
                </div>
                <div className="row">
                    <div className="col-6">
                       <div className="m-2">
                           <h3>Detail</h3>
                           <p>lorem poarhejfjdfkusdfg jkdsfgudsfgjksnjfhsirjzeiojriozjetknfiosh</p>
                       </div>
                    </div>
                    <div className="col-6">
                        <div className="card m-2">
                            <div className="card-body">
                                <h5 className="card-title">For reservation</h5>
                                <p> ghade deri hanaya dakchi li deja endk</p>
                                <p class="date-label">ARRIVÉE</p>
                    <DatePicker
                        selected={this.state.arrivalDate}
                        onChange={date => this.setState({ arrivalDate: date })}
                        placeholderText="Select date"
                    />
                </div>
                <div class="booking-option">
                    <p class="date-label">DÉPART</p>
                    <DatePicker
                        selected={this.state.departureDate}
                        onChange={date => this.setState({ departureDate: date })}
                        placeholderText="Select date"
                    />

                                <input className="row" />
                                <input className="row" /><input className="row" /><input className="row" /><input className="row" />
                                <button>Submit </button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default LocalDetails;
